import React, {Component} from "react";

class Message extends Component{

    constructor(){
        super()
        this.state={
            message:"Hello world from Message1"
        }
    }

    render(){
        return(
        <div>
            <h1>{this.state.message}</h1>
            <button>Change</button>
        </div>
        );
    }

}
export default Message
